import React from 'react';
import { Link } from 'react-router-dom';
export default function Header() {
  return (
    <div className='nav-bar'>
      <nav>
        <Link to={'/'}>Home</Link>
        <Link to={'/'}>Account</Link>
        <Link to={'/'}>Setting</Link>
        <Link to={'/auth/login'}>Login</Link>
      </nav>
    </div>
  )
}
